import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CustomerDashBoard from './customers'; // Import your CustomerTable component
import ColorTiles from './ColorTiles'; // Import your ColorTiles component

function App() {
  return (
    <Router>
      <Routes>
          <Route exact path="/" component={CustomerDashBoard} />
          <Route path="/colorTiles/:OAN" component={ColorTiles} />
      </Routes>
    </Router>
  );
}

export default App;


